import React from 'react';
import Footer from '../Footer/Footer';
import NavBar from '../Navbar/NavBar';
import {Link, useLocation} from "react-router-dom";
import { TextField , MenuItem, useMediaQuery  } from '@mui/material';
import FormControl from '@mui/material/FormControl';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import './SignUp.css'
import SignInButton from './SignInbutton'
import IconButton from '@mui/material/IconButton';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import InputAdornment from '@mui/material/InputAdornment';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import theme from '../SignUp/theme';



export default function Login (){

    function handleSubmit(){
        alert('logged in...')
    }
    
    return(
        <>
            <NavBar/>
        <div className="signup">
            <div className="signupHeader">
                <Link to='/'>
                    <div className="backarrow">
                        <img src="https://res.cloudinary.com/do5wu6ikf/image/upload/v1684452441/starpenzu/back_qpybto.svg" alt=""/>
                    </div>
                </Link>

                <div className="signupTitle">
                    Login
                </div>
            </div>

            <ThemeProvider theme={theme}>
                <form action="" noValidate onSubmit={handleSubmit} className="register">

                    <div className="cluse">
                        <TextField
                            sx={{
                                fontFamily: 'Clash display',
                                fontSize:18
                            }}
                            error={!!formErrors.email}
                            className='outlined'
                            id="outlined-basic-5"
                            label="Email"
                            color='secondary'
                            variant="outlined"
                            margin="dense"
                            type="email"
                            required
                            name={"email"}
                            value={formData.email}
                            onChange={handleChange}
                        />
                    </div>


                </form>
            </ThemeProvider>

        </div>
        <Footer/>
        </>
    )
}
